#include<iostream>
#include<vector>
#include<stack>
#include<algorithm>
#include<unordered_map>

#include<string>
#include<math.h>
#include<limits.h>

using namespace std;


class Solution {
public:
//解法一 哈希表
    char findTheDifference(string s, string t) {
        if(s.empty())
        {
            return t[0];
        }
        unordered_map<char,int> map{};
        for (size_t i = 0; i < s.size();i++)
        {
            map[s[i]]++;
        }
        for (size_t j = 0; j < t.size();j++)
        {
            map[t[j]]--;
            if (map[t[j]] <0)
            {
                return t[j];
            }
        }
        return {};
    }

//解法二 求和
char findTheDifference1(string s, string t) {
    int sumS{0}, sumT{0};
    for (size_t i = 0; i < s.size();i++)
    {
        sumS += s[i];
    }
    for (size_t i = 0; i < t.size();i++)
    {
        sumT += t[i];
    }
    return sumT - sumS;
}
//解法三 位运算
//  位运算  成对的两个相同的数字亦或 为0 ，所以遍历一遍，只剩下了单个的数字。
char findTheDifference2(string s, string t) {
    int re{0};
    for (size_t i = 0; i < s.size();i++)
    {
        re = re ^ s[i];
    }
    for (size_t i = 0; i < t.size();i++)
    {
        re = re ^ t[i];
    }
    return re;
}
};




int main()
{
    string s{""};
    string t{""};
    Solution solu;
    cout << solu.findTheDifference2(s, t) << '\n';
    return 0;
}
